        sff7077aab076f473: "Bluetooth verbinden",
        "specificity-warning": O`Das ausgewhlte Testkit ist bekannt dafr, hufiger falsch-positive Ergebnisse zu produzieren als andere Tests, insbesondere bei sichtbaren Luftblasen oder pltzlichen Sprngen in den Kurven. Positive Tests sollten wiederholt werden, wenn keine eindeutige Amplifikationsreaktion zu erkennen ist. <b>Ein Anstieg direkt nach Testbeginn</b> ist kein positives Ergebnis, da eine echte Amplifikationsreaktion immer erst nach einigen Minuten sichtbar wird.`,
        "test-view-already-testing-warning": O`Beim Verbinden zu einem laufenden Test bitte beachten: Die Testkonfiguration wird <b>einmalig, und zwar beim Starten des Tests, an das Gert geschickt</b>. Wenn der Test mit dem Knopf am Gert gestartet wird, wird immer ein SARS-Cov-2-Test gestartet. Wenn beim Verbinden zu einem laufenden Test ein anderes Kit ausgewhlt wird, hat das keine Auswirkung auf den laufenden Test - die Auswertung findet trotzdem anhand des ursprnglichen Testkits statt. Eine nachtrgliche nderung ist nicht mglich und fhrt dazu, dass die App die Testergebnisse nicht korrekt anzeigen kann.`,
        "webbluetooth-chromium-only": O` Dieser Browser oder dieses Gert untersttzen keine Verbindung zu Pluslife-Gerten. Es werden nur Chromium-basierte Browser wie <a href="https://chrome.google.com/" target="_blank"> Google Chrome</a>, Microsoft Edge oder Vivaldi untersttzt. `,
